import React, { Component } from 'react';

class Feed extends Component {
    render(){
        return(
            <div key={item.id}>
            <h3>{item.username}</h3>
            <a>{item.likes} Likes &#9829; | Comments: {item.comments} </a>
          </div>

        );
    }
}

export default Feed;
